var app=angular.module("assignmentApp",[]);console.log("Angular is running"),app.controller("StuffController",["$scope","$http",function(a,b){a.assignment={},a.assignments=[],a.getAssignments=function(){b.get("/assignmentsData").then(function(b){console.log(b),a.assignments=b.data})},a.sendData=function(){b.post("/assignmentsData/add",a.assignment).then(function(b){console.log(b),a.assignment={},a.getAssignments()})},window.setInterval(a.assignments,5e3),a.getAssignments()}]);